/**
 * @param {number[]} arr
 * @param {number} k
 * @return {number[]}
 */
 var kthSmallestPrimeFraction = function (arr, k) {
    let len = arr.length;
    let res = new Array();
    let end = 1

    var compare = function (arr, firChar, secChar) {
        if (arr.length == 0) {
            arr.push([firChar, secChar])
            return arr
        }
        let val = firChar / secChar
        for (let i = 0; i < arr.length; i++) {
            let curVal = arr[i][0] / arr[i][1]
            if (curVal > val) {
                if(i==0){
                    arr.unshift([firChar, secChar])
                }else{
                    arr.splice(i, 0, [firChar, secChar])
                }
                return arr
            }
        }
        arr.push([firChar, secChar])
        return arr
    }
    while (end < len) {
        for (let i = 0; i < end; i++) {
            res = compare(res, arr[i], arr[end])
        }
        end++
    }
    return res[k-1]
};






